import { store } from "../store";
import DashboardLayout from "@/layout/dashboard/DashboardLayout.vue";
// GeneralViews
import NotFound from "@/pages/NotFoundPage.vue";

// Admin pages
import Dashboard from "@/pages/Dashboard.vue";
import UserProfile from "@/pages/UserProfile.vue";
import Notifications from "@/pages/Notifications.vue";
import Icons from "@/pages/Icons.vue";
import Maps from "@/pages/Maps.vue";
import Typography from "@/pages/Typography.vue";
import TableList from "@/pages/TableList.vue";
import UploadPhoto from "@/pages/UploadPhoto.vue";
import Home from "@/pages/Home.vue";
import Login from "@/pages/Login.vue";
import Register from "@/pages/Register.vue";
import Company from "@/pages/Company.vue";
import Plan from "@/pages/Plan.vue";
import Inspection from "@/pages/Inspection.vue";
import Gallery from "@/pages/Gallery.vue";
import Drone from "@/pages/Drones.vue";
import User from "@/pages/Users.vue";
import Pilot from "@/pages/Pilots.vue";
import Prices from "@/pages/Prices.vue";
import Pay from "@/pages/Pay.vue";

const routes = [
  {
    path: "/",
    component: DashboardLayout,
    redirect: "/home",
    children: [
      {
        path: "dashboard",
        name: "dashboard",
        component: Dashboard,
      },
      {
        path: "users",
        name: "users",
        component: User,
      },
      {
        path: "notifications",
        name: "notifications",
        component: Notifications
      },
      {
        path: "icons",
        name: "icons",
        component: Icons
      },
      {
        path: "maps",
        name: "maps",
        component: Maps
      },
      {
        path: "typography",
        name: "typography",
        component: Typography
      },
      {
        path: "table-list",
        name: "table-list",
        component: TableList
      },
      {
        path: "upload-photo",
        name: "upload-photo",
        component: UploadPhoto
      },
      {
        path: "profile",
        name: "profile",
        component: UserProfile
      },
      {
        path: "company",
        name: "company",
        component: Company
      },
      {
        path: "plans",
        name: "plans",
        component: Plan
      },
      {
        path: "drones",
        name: "drones",
        component: Drone
      },
      {
        path: "inspection",
        name: "inspection",
        component: Inspection
      },
      {
        path: "gallery",
        name: "gallery",
        component: Gallery
      },
      {
        path: "pilot",
        name: "pilot",
        component: Pilot
      },
    ]
  },
  {
    path: "/home",
    name: "home",
    component: Home
  },
  {
    path: "/login",
    name: "login",
    component: Login,
  },
  {
    path: "/register",
    name: "register",
    component: Register
  },
  {
    path: "/prices",
    name: "prices",
    component: Prices
  },
  {
    path: "/pay",
    name: "pay",
    component: Pay,
    beforeEnter: (to, from, next) => {
      if(store.state.jwt != null){
        next()
      }else{
        next({ name: 'login',  params: {'from':'pay'} })
      }
      // if(typeof(store.state.jwt) != "undefined"){
      //   next();
      // }else{
      //   alert("HOla")
      //   next(false);
      // }
    }
  },
  { path: "*", component: NotFound }
];

/**
 * Asynchronously load view (Webpack Lazy loading compatible)
 * The specified component must be inside the Views folder
 * @param  {string} name  the filename (basename) of the view to load.
function view(name) {
   var res= require('../components/Dashboard/Views/' + name + '.vue');
   return res;
};**/

export default routes;
